    }
  
   
  render (){
    return (
        <div class="flex h-[85vh] flex-col text-[#ffffff] bg-[#272727] items-center">
        <div class="w-full md:w-[80vw] lg:w-[60vw] p-2">
        <div class="">
          <h1 class="text-3xl mb-4 pl-2 mt-4">Welcome!</h1>
          <p class="text-justify px-2">
